const Header = (props) => {
  console.log(props)
  return (
    <div>
      <p>{props.course}</p>
    </div>
  )
}

const Content = (props) => {
  return (
    <div>
      <p>{props.part1}</p>
      <p>{props.part2}</p>
      <p>{props.part3}</p>
    </div>
  )
}

const Total = (props) => {
  return (
    <div>
      <p>{props.exercises1} exercises</p>
      <p>{props.exercises2}</p>
      <p>{props.exercises3}</p>
    </div>
  )
}

const App = () => {
  const course = {
    name: 'Half Stack application development',
    parts: [
      {
        name: 'Fundamentals of React',
        exercises: 10
      },
      {
        name: 'Using props to pass data',
        exercises: 7
      },
      {
        name: 'State of a component',
        exercises: 14
      }
    ]
  }


  return (
    <div>
      <h1><Header course={course}/></h1>
      <p>
        <Content part1={part1}/> <Total exercises1={exercises1}/>
      </p>
      <p>
      <Content part1={part2}/> <Total exercises1={exercises2}/>
      </p>
      <p>
      <Content part1={part3}/> <Total exercises1={exercises3}/>
      </p>
      <p>Total number of exercises {exercises1 + exercises2 + exercises3}</p>
    </div>
  )
}

export default App
